import React from 'react';

function RowsForColumns({
  firstName,
  lastName,
  email,
  phone,
  location,
  image,
}) {
  return (
    <tr>
      <td>
        <img alt="" src={image} />
      </td>
      <td>
        <h2>{firstName}</h2>
      </td>
      <td>
        <h2>{lastName}</h2>
      </td>
      <td>
        <h5>{email}</h5>
        <h5>{phone}</h5>
        <h5>{location}</h5>
      </td>
    </tr>
  );
}
export default RowsForColumns;
